import img1 from '../../images/mobile.png'
import ReactImageGallery from 'react-image-gallery';
import BtnLeft from './BtnLeft';
import BtnRight from './BtnRight';
const ProducteDetalisGallery = () => {
    const images = [
        {
          original:`${img1}`,
        
        },
        {
          original:`${img1}`,
        
        },
        {
          original:`${img1}`,
        
        },
      ];
  return (
    <div className=" mt-3 product-gallary-card d-flex justfiy-content-center  align-items-center
    pt-2">

        <ReactImageGallery items={images} 
        renderLeftNav={BtnLeft}
        renderRightNav={BtnRight}
        sh
        />
    </div>
  )
}

export default ProducteDetalisGallery
